	/**
	 * 
	 * @param filePath 上传文件的路径  C:/Users/deertt/Desktop/timg.jpg
	 * @param bucketName 七牛云上传的空间名称  deerttgoods
	 * @param fileKey 上传到七牛后保存的文件名  timg.jpg
	 * @return
	 */
	public static boolean upload(String filePath, String bucketName, String fileKey) {
		boolean ret = false;
	    //密钥配置
	    Auth auth = Auth.create(ACCESS_KEY, SECRET_KEY);
	    
	    String upToken = auth.uploadToken(bucketName);

	    ///////////////////////指定上传的Zone的信息//////////////////
	    //第一种方式: 指定具体的要上传的zone
	    //注：该具体指定的方式和以下自动识别的方式选择其一即可
	    //要上传的空间(bucket)的存储区域为华东时
	    Zone z = Zone.zone0();
	    //要上传的空间(bucket)的存储区域为华北时
	    // Zone z = Zone.zone1();
	    //要上传的空间(bucket)的存储区域为华南时
	    // Zone z = Zone.zone2();

	    //第二种方式: 自动识别要上传的空间(bucket)的存储区域是华东、华北、华南。
	    //Zone z = Zone.autoZone();
	    Configuration c = new Configuration(z);

	    //创建上传对象
	    UploadManager uploadManager = new UploadManager(c);
        try {
            //调用put方法上传
            Response res = uploadManager.put(filePath, fileKey, upToken);
            //打印返回的信息
            System.out.println(res.bodyString());
            ret = true;
        } catch (QiniuException e) {
            Response r = e.response;
            // 请求失败时打印的异常的信息
            System.out.println(r.toString());
            try {
                //响应的文本信息
                System.out.println(r.bodyString());
            } catch (QiniuException e1) {
                //ignore
            }
        }
        
        return ret;
	}

